import React from 'react';

import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import LockIcon from './components/LockIcon';

function App() {
  return (
    <main>


      <header>
        <div className="App">
          <AppBar position="static">
            <Toolbar style={{ backgroundColor: "#8C661F" }}>
              <h2>노인을 위한 나라</h2>
            </Toolbar>
            <LockIcon />
          </AppBar>

        </div>
      </header>
      <div>
        <h2>복지관위치</h2>
        <KokoMap/>
      </div>


    </main>
  );
}

export default App;
